import dtlpy as dl

class ServiceRunner:

    def run(self, item):
        filters = dl.Filters(field='metadata.user.extracted_from_pdf', values=True)
        filters.add(field='metadata.user.original_item_id', values=item.id)
        filters.add(field='metadata.system.mimetype', values="text/plain")
        items = item.dataset.items.list(filters=filters).items

        for item in items:
            yield item
